import React, {Component} from 'react';

const TableHead = () => {
    return (
    <thead>
        <tr>
            <th>Autores</th>
            <th>Livros</th>
            <th>Pre√ßos</th>
            <th>Remover</th>
        </tr>
    </thead>
    );
}

const TableBody = () => {
    return(
    <tbody>
        <tr>
            <td>Paulo</td>
            <td>React</td>
            <td>1000</td>
            <td><button>Remover</button></td>
        </tr>
        <tr>
            <td>Nico</td>
            <td>React</td>
            <td>1000</td>
            <td><button>Remover</button></td>
        </tr>
        <tr>
            <td>Daniel</td>
            <td>React</td>
            <td>1000</td>
            <td><button>Remover</button></td>
        </tr>
    </tbody>
    );
}

class Tabela extends Component {
    render() {
        const {autores} = this.props;
        return (
            <table>
                <TableHead />
                <TableBody />
            </table>
        );
    }
}

export default Tabela;
